import React, { Component } from "react";
import Header from "../components/Header"
import "./styles/Home.css";

export default class Home extends Component {
  render() {
    return (

        <React.Fragment>
            <Header /> 

            <div className="container-fluid row">
                <div className="col-3 item">
                    <p> Nuevo humano </p>
                </div>
                <div className="col-3 item">
                    <p> Analizar Humano </p>
                </div>
                <div className="col-3 item">
                    <p> Con Mutacion </p>
                </div>
                <div className="col-3">
                    <p> Sin Mutacion </p>
                </div>
            </div> 

        </React.Fragment>
    );
  }
}
